import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Register from './components/Register';
import Login from './components/Login';
import TodoApp from './components/TodoApp'; // Main Todo app component
import Header from './components/Header'; // Optional header with navigation links

function App() {
  const isAuthenticated = !!localStorage.getItem('token'); // Simple check for authentication

  return (
    <Router>
      <Header /> {/* Include Header for navigation if needed */}
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/login" element={<Login />} />
        <Route
          path="/"
          element={isAuthenticated ? <TodoApp /> : <Login />} // Redirect to Login if not authenticated
        />
      </Routes>
    </Router>
  );
}

export default App;
